	add("turmoil", "{\"term\":\"turmoil\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"{{unk.|en}} origin. Perhaps from Old french (842-ca. 1400) \u0027lang\u003dfro|tremouille\u0027 () \u0026lt;!-- Webster 1913, Century 1911; also OEtD, which speaks of M.Fr. tremouille. --\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A state of great disorder or uncertainty\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Harassing labour; trouble; disturbance\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"And there I\u0027ll rest, as after much \u0027\u0027turmoil\u0027\u0027, / A blessed soul doth in Elysium\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dThe \u0027\u0027turmoil\u0027\u0027 went on\u0026amp;mdash;no rest, no peace. […] It was nearly eleven o\u0027clock now, and he strolled out again. In the little fair created by the costers\u0027 barrows the evening only seemed beginning; and the naphtha flares made one\u0027s eyes ache, the men\u0027s voices grated harshly, and the girls\u0027 faces saddened one\", \"priority\":5}]}, \"synonyms\":{}}");

	add("turnbuckle", "{\"term\":\"turnbuckle\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Image:Turnbuckle.jpg|thumb|right|A turnbuckle.From turn + buckle\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A coupling device consisting of two eyelets or other connection points connected in screw threads. The joint in between can be turned to shorten or lengthen the device with mechanical advantage provided by the screw threads\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A link threaded on both ends of a short bar which is used to pull objects together. (FM 55-501\", \"priority\":2}]}, \"synonyms\":{}}");

